INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('The Return of Superman', 1, 1, '1. Things You Only Realize Once You Raise Them', 'Choo Sunghoon and Sarang are going to Osaka to meet Sunghoon''s parents.  Tablo is recovering from shoulder surgery, will he be able to look after  his daughter Haru? Lee Hwi-jae has become the god of child care, now  that he''s familiar with taking care of his twins, Seoeon and Seojun. He  goes to see an eye doctor to check the twin''s eyes. The charismatic  actor Jang Hyunsung is actually a very clumsy person at home. He''s very  friendly with his two sons, Junu and Junseo. He teaches Junseo how to  ride a bicycle without training wheels.', 85);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('The Return of Superman', 1, 2, '2. They''re Just Like Me', 'Sunghoon and Sarang have so much fun in Osaka, Sarang spends her birthday at her grandparents house and experiences various things she had never done before. Meanwhile, Tablo and Haru goes to the aquarium to see fishes which is Haru favorite thing in the world. Hwijae, worried about the twin''s eyes, takes them to an eye doctor. They get their eyes checked up and Hwijae gets so scared by the sound of their crying. Also he takes them to a baseball park with him. Hyunsung goes to Junu''s parent-teacher conference and gets surprised by Junu''s letter and his performance in school.', 85);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('The Return of Superman', 1, 3, '3. I Can''t Live Without You', 'Sunghoon and his dad wants to teach Sarang judo. Sarang is now getting along well with her grandparents and Sarang''s mom, Shiho Yano arrives in Osaka. Haru wants to treat her dad''s arm. Tablo starves for two days and realizes how hard it was for his wife Hyejung to look after Haru. It''s Haru''s first time spending two days without her mom. Hwijae''s wife told Hwijae to go to culture center. Will he be able to take care of the twins? Hyunsung tries to cook curry but he doesn''t even know how to peel carrots, also Hyunsung and his boys prepare a surprise for their mom for their wedding anniversary.', 85);
