INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Grey''s Anatomy', 1, 1, 'A Hard Day''s Night', 'Meet Meredith Grey. Daughter of famous surgeon Ellis Grey and currently recovering from a one-night stand. She shoos away her evening''s companion, saying she''ll be late for her first day of work. She is a first year intern at Seattle Grace Hospital and is working alongside some colorful characters. Cristina Yang is a highly competitive Stanford graduate who befriends Meredith. George O''Malley is a quirky warm hearted man who learns a lesson or two on his first day. Izzie Stevens is a former model who doesn''t get any special treatment on her first day. And Alex Karev is an arrogant jerk who misdiagnoses a patient on his first shift. Overseeing them is Miranda Bailey, (not-so-) affectionately dubbed ''The Nazi''. Meredith also gets a surprise when she realizes that her friend from the night before is a co-worker, and even worse, her boss.', 43);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Grey''s Anatomy', 1, 2, 'The First Cut is the Deepest', 'The surgical staff tries to be optimistic as a young woman clings to life after a brutal attack. Meanwhile Meredith puts her career on the line to save a newborn in the hospital nursery, and the other interns learn that it takes more than just medical knowledge to be good at their jobs.', 43);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Grey''s Anatomy', 1, 3, 'Winning a Battle, Losing the War', 'A bike race injures several pedestrians as well as well as participants.  One pedestrian is left brain dead.  Christina and Issie wish to use his organs for organ donation but with Christina''s detachment and Issie''s ever hopeful attitude that the man will recover, they will find the organ harvesting process an emotional one.  Preston faces feelings of his dislike of organ harvesting - as a surgeon, he likes saving lives; harvesting organs doesn''t save the person''s life.  George deals with Mac, a friend of the chief, who won''t stop flirting with him.  He is in need of a new liver.   Meredith is fed up with Alex showing off as she continues trying to push Derek away.  She also is reaching the limits of Issie''s sunshine and George''s politeness as she goes on living with them.  Then there is their desire to see Meredith''s mother''s medical tapes.  Getting through the day, Meredith realizes the keys to winning the race.', 43);
