INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Supernatural', 1, 1, 'Pilot', 'Two brothers, Sam and Dean Winchester,  witness their mother''s paranormal death as children and grow up trained  to fight by a distraught father who wants nothing more then to hunt  down the thing that killed his wife. Sam escapes to college to start a  new, normal life, but gets pulled back in after Dean shows up on his  doorstep to tell him their father is missing.
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Supernatural', 1, 2, 'Wendigo', 'Sam and Dean follow the coordinates  left in their father''s journal and land in the middle of the woods where  they investigate the disappearance of several campers. The two brothers  soon learn they are dealing with a Wendigo, a creature made famous in  Native America legends. A Wendigo is a former human whose cannibalism  has transformed him into a creature with superhuman strength and speed  that feasts on human flesh.', 43);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Supernatural', 1, 3, 'Dead in the Water', 'Sam and Dean investigate a series of  mysterious drownings written off as suicides. They discover the spirit  is an angry little boy with the power to travel through water who is  taking revenge on certain town inhabitants for a dark secret buried long  ago. Dean forms a bond with a young boy who seems to have the power of  premonition.', 43);
