INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Family Guy', 1, 1, 'Death Has a Shadow', 'After Peter heavily drinks at a bachelor party, even though he told Lois he would not, he gets fired from his job at the Happy-go-Lucky toy factory for being hung over. Peter soon applies for welfare, but after a mix-up, gets sent a check for $150,000. Eventually, Lois finds out, and Peter decides to return the money by dumping it from a blimp at the Super Bowl. He is arrested as a result, and his family ends up coming to his rescue.', 23);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Family Guy', 1, 2, 'I Never Met the Dead Man', 'While teaching Meg to drive, Peter crashes into the town satellite dish, which knocks out the city''s cable. He promises Meg that if she takes the blame, he''ll get her a car. Without TV, Peter goes crazy, which drives the family insane. Meanwhile, after refusing to eat the broccoli that Lois gives him, Stewie attempts to build a weather control device that would destroy all vegetables.', 22);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Family Guy', 1, 3, 'Chitty Chitty Death Bang', 'Peter Allows Meg to go to a party with her new friend. This angers Lois because its the same day as Stewie''s birthday. What Meg doesn''t know is that she''s actually attending a cult meeting. Peter comes to pick up Meg, when the Cult Leader follows. Stewie believes him to be the "Man in White", trying to return him to the womb.', 23);
