INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Maxton Hall - The World Between Us', 1, 1, 'Under the Radar', 'When reserved scholarship student Ruby Bell witnesses an explosive secret, she finds herself in the crosshairs of privileged and arrogant millionaire heir James Beaufort. She is actually working towards her lifelong dream at the elite Maxton Hall School: studying at Oxford University. But her perfect plan is thrown into turmoil by James'' appearance.', 47);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Maxton Hall - The World Between Us', 1, 2, 'Noblesse Oblige', 'After the ruined welcome party, Ruby does everything she can to make sure things at the upcoming fundraiser run perfectly. That''s why it doesn''t suit her at all that James is now forced to be part of the committee and is celebrated there for his ideas. After an unexpectedly heated exchange between the two, it is suddenly Ruby herself who has to admit that she has gone too far.', 45);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Maxton Hall - The World Between Us', 1, 3, 'Exposed', 'Ruby and James get closer than ever at the Beaufort Store in London. But a surprise meeting with James'' parents brings Ruby back down to earth: She doesn''t belong in this world. When a poster of her and James makes her the No. 1 topic of conversation on the next school day, she makes an announcement to James: She wants to cut ties with him. For James, however, that is no longer an option.', 53);
INSERT IGNORE INTO `Konten` (`judul`,`sinopsis`,`tahun_rilis`,`rating_usia`,`type`) VALUES ('The Blacklist', 'Raymond "Red" Reddington, one of the FBI''s most wanted fugitives, surrenders in person at FBI Headquarters in Washington, D.C. He claims that he and the FBI have the same interests: bringing down dangerous criminals and terrorists. In the last two decades, he''s made a list of criminals and terrorists that matter the most but the FBI cannot find because it does not know they exist. Reddington calls this "The Blacklist". Reddington will co-operate, but insists that he will speak only to Elizabeth Keen, a rookie FBI profiler.', 2013, 'TV-14', 'Serial_TV');
