INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Midsomer Murders', 1, 2, 'Written in Blood', 'Gerald Hadleigh, secretary of a writers'' circle, is found battered to death the morning after the group''s meeting with best-selling novelist (and former psycho-therapist) Max Jennings. Gerald did not want to invite Max to Midsomer Worthy, and he seemed apprehensive about the visit.Barnaby''s investigations show that Gerald was a man of mystery - he had no National Insurance number, no family, and no marriage certficate to go with his wedding photographs. And it seems he had a mysterious woman visitor on the night of his death... then Max Jennings goes missing and is found dead.', 101);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Midsomer Murders', 1, 3, 'Death of a Hollow Man', 'The body of Agnes Gray, a woman who loved only animals, is found in the river - but she did not drown.  And then her cousin Esslyn Carmichael is tricked into killing himself on stage during an amateur production of the murder mystery Amadeus. Barnaby has to get to grips with clues which include adultery, dramatic ambition, stolen religious art, and large donations to animal charities, before unmasking a killer who proves to be mad.Meanwhile, love begins to blossom between Cully Barnaby and Nico Bentley, one of the cast of Amadeus...', 98);
