INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Absentia', 1, 1, 'Comeback', 'After years of assuming FBI Agent Emily Byrne was a possible victim of serial killer Conrad Harlow, she is miraculously returned to her family. Emily, however, has to struggle with the mysteries of her captivity and the fact that everyone has moved on without her. Investigating Emily’s disappearance, her husband Nick Durand detects a connection between Emily and a sex trafficker Robert Semerov, who has negative feelings about Emily. When the FBI traces the sex trafficker, suspicion suddenly moves to Emily. Is she still the same person they knew?', 51);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Absentia', 1, 2, 'Reset', 'Emily’s alleged serial killer, Conrad Harlow, is being released from jail, and Emily has not come close to solving the mystery of her kidnapping and time in captivity. As Emily struggles to return to normal life, a witness turns up and reinforces the suspicions of Emily. Emily denies the suspicions and is sure the witness is lying and was forced into making a false statement, maybe by someone in the FBI. Will Emily and Nick be able to find out the truth before Emily is again torn from her family?', 43);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Absentia', 1, 3, 'The Emily Show', 'When the testifying witness against Emily is murdered, all signs suggest that the murder was committed by Emily. While Tommy Gibbs and the Boston Police Chief are accusing Emily, she and Nick look for an FBI agent who forced the witness to lie. For Emily, there is suspicion that this agent is the one responsible for her abduction.', 46);
INSERT IGNORE INTO `Konten` (`judul`,`sinopsis`,`tahun_rilis`,`rating_usia`,`type`) VALUES ('Bones', 'Dr. Temperance Brennan and her colleagues at the Jeffersonian''s Medico-Legal Lab assist Special Agent Seeley Booth with murder investigations when the remains are so badly decomposed, burned or destroyed that the standard identification methods are useless.', 2005, 'TV-14', 'Serial_TV');
