INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Robin Hood', 1, 3, 'No Man Can Hide Forever', 'The death of Huntingdon''s son deepens the rift between Normans and Saxons. Rob gains a powerful ally in Little John, but the Sheriff''s pursuit grows, driving the outlaws deeper into Sherwood. Marian enters the dazzling yet perilous court in Westminster.', 52);
