INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('One-Punch Man', 1, 1, 'The Strongest Man', 'Saitama is a guy who’s a hero for fun. After saving a child from certain death, he decided to become a hero and trained hard for three years. Though he’s now so strong he can defeat any opponent with a single punch, lately he feels as if, in exchange for overwhelming power, he’s lost something even more important.', 24);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('One-Punch Man', 1, 2, 'The Lone Cyborg', 'A monster is moving toward City Z, one that has been  created by the mysterious organization known as The House of Evolution.  Genos, a young cyborg, attempts to stop it, but gets in over his head  before Saitama happens along.', 24);
