INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('American Dad!', 1, 1, 'Pilot', 'Stan Smith uses his CIA skills to help 13-year-old son Steve win class president and the heart of the hottest girl in class, Lisa Silver. But when being class president makes Steve mad with power, Stan must jump in to save the day. Meanwhile, Roger, the alien Stan saved from Area 51, helps 18-year-old Hayley with her school paper. In return, she hooks him up with boatloads of junk food to curb his sweet tooth. Unfortunately, some Chocodiles send him over the edge and a sugar crash prohibits him from finishing one of her papers, forcing Hayley to pick up the pieces. And Klaus, the goldfish with the brain of a German guy, pines after mother Francine. Unfortunately for Klaus, the closest he''ll ever get to a date with her is the spin cycle with her sports bra.', 22);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('American Dad!', 1, 2, 'Threat Levels', 'Stan Smith is mad because after getting his wife a job (or "hobby") as a Real Estate agent, she makes more money than him. In the meantime, his daughter Hayley ran a program that helped the homeless, and Stan''s son Steve had an idea to have a Bum Fight program. To get back and to try to gain more money than his wife, Stan takes Steve''s idea and starts a Bum Fight Night where he takes bets and treats the homeless like wrestlers. But with the homeless petition, Stan has to end up fighting like a homeless man himself.', 22);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('American Dad!', 1, 3, 'Stan Knows Best', 'Hayley comes home from a Green Party rally with her hair dyed green, instigating a fight with Stan. While she''s sleeping, Stan cuts her hair (for her own good, of course). After learning of what Stan did, a wigged Hayley defies her father yet again by moving into the van of her new boyfriend. When Stan cuts her off financially, she gets a job as a waitress in a strip club, which pushes Stan right off the edge. Meanwhile, Steve tries to pass Roger off as his disfigured sister in order to cop a feel with a female classmate.', 22);
