INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('CSI: Crime Scene Investigation', 1, 1, 'Pilot', 'Gil Grissom is the supervisor of the graveyard shift of Las Vegas'' elite crime scene investigators. Holly Gribbs, fresh out of the academy, joins the team.  Jim Brass is head of the unit and is trying to scare Gribbs from CSI.  Catherine Willows, mother of a young daughter, is the number two CSI on this shift.  Warrick Brown and Nick Stokes are competing to solve their 100th case to earn a promotion to CSI 3. Grissom investigates a murder staged to look like a suicide with precious little evidence.  Warrick and Catherine take the case of a drunk who breaks into the house where he had been staying and is shot to death. Nick talks to a man who picked up a woman who drugged and robbed him.', 46);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('CSI: Crime Scene Investigation', 1, 2, 'Cool Change', 'A man is killed after winning a fortune and then dumping his girlfriend.  So, Grissom, Nick, and newcomer to the CSI team, Sara Sidel, investigate this one.  Holly Gribbs is in the hospital and Warrick is up for suspension for leaving her at the crime scene by herself.  Holly later dies in the hospital, but Grissom doesn''t suspend Warrick.', 44);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('CSI: Crime Scene Investigation', 1, 3, 'Crate ''n Burial', 'Grissom, Nick, and Sara search for a kidnapped woman and find more than they expected. Catherine and Warrick investigate the hit and run death of a little girl.', 45);
INSERT IGNORE INTO `Konten` (`judul`,`sinopsis`,`tahun_rilis`,`rating_usia`,`type`) VALUES ('Esref Ruya', 'As a child, Eşref fell in love from afar with a girl he called “Rüya” and spent years searching for her, only to become a powerful mafia figure along the way. Meanwhile, Nisan, an idealistic musician, finds herself in grave danger after performing at a wedding held at Eşref’s hotel. Eşref falls for Nisan, unaware that she is both the long-lost Rüya he has been chasing for years and a police informant. Trapped in a whirlwind of love, betrayal, and power struggles, Eşref is forced into a brutal reckoning—both with his criminal empire and his own emotions.', 2025, 'NR', 'Serial_TV');
