INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Esref Ruya', 1, 1, 'Episode 1', 'Eşref Rüya tells the story of a young man who is a prisoner of a love whose name he does not know. Çağatay Ulusoy plays the character Eşref, who is reckless, has everything but is a prisoner of a love whose name he does not know, while Demet Özdemir plays Nisan, the young musician who makes Eşref''s heart skip a beat.', 137);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Esref Ruya', 1, 2, 'Episode 2', 'Nisan, who understands that she is in great danger once again with this incident, looks for ways to escape Çiğdem''s games. Eşref cannot help but be carried away by feelings that he is unfamiliar with whenever he comes face to face with Nisan. Nisan''s getting closer to Eşref causes alarm bells to ring for both of them. On the other hand, a great surprise awaits İzzet, who is drunk with victory. Eşref, who is preparing to make his enemies experience hell, will also face his new rival on the security front.', 116);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Esref Ruya', 1, 3, 'Episode 3', 'After İzzet’s death, Eşref now faces an even greater enemy. Horrified by everything that’s happened, Nisan prepares to make bold moves beyond her limits in order to finally end the game. Meanwhile, with his plans progressing as intended, Kadir is willing to betray the Yetimler to eliminate Eşref from the picture. On the law enforcement side, Serdar investigates the murder at the hotel and comes face to face with Eşref and the tribe. This tense confrontation—where everything could fall apart at any moment—sets the stage for an impending major conflict. Though Nisan plans to throw Eşref into the fire to save herself, seeing a different side of him pushes her into an unexpected dilemma. Her growing closeness with Eşref is about to land her in serious trouble.', 137);
