INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('24', 1, 1, '12:00 A.M.-1:00 A.M.', 'Moments after discovering his daughter, Kimberly, has snuck out of the house, Jack Bauer is called into work. As head of the CIA''s Los Angeles Counter Terrorist Unit office he''s told that an assassination attempt will be made within the next 24 hours on the life of presidential candidate David Palmer and it''s up to his team of agents to keep Palmer alive. Meanwhile, Jack''s wife, Teri, sets out to find their daughter.', 43);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('24', 1, 2, '1:00 A.M.-2:00 A.M.', 'Teri receives a phone call from Alan York who says his daughter, Janet, is a friend of Kimberly''s and is also missing, so the two parents join forces to try and find the girls. Even as Jack is secretly called out of the office and given an encrypted key card containing information on the Palmer hit that could lead him to a dirty agent within his organization, the explosion of a 747 over the Mojave Desert becomes yet another piece in the puzzle.', 41);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('24', 1, 3, '2:00 A.M.-3:00 A.M.', 'Kimberly and Janet realize they are in danger after it becomes clear that their two dates have kidnapped them. Despite the threat on his life, Senator Palmer sneaks out of his hotel to meet a reporter who has damaging information that could affect his campaign. Back at the office, Jack has Jamey, a member of his team, decrypt the key card.', 43);
