INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Chicago Fire', 1, 1, 'Pilot', 'When a fire claims one of their own, there''s plenty of guilt and blame to go around. Lt. Matthew Casey, in charge of the Truck, tries to carry on, but butts heads with the brash Lt. Kelly Severide of the Rescue Squad - and each blames the other for their fallen team member. The firehouse also includes: Battalion Chief Wallace Boden, a fireman''s fireman who is confronted by important personal decisions; paramedics Gabriela Dawson and Leslie Shay, who share a close bond and team together to face some of the most harrowing situations imaginable; Peter Mills, an academy graduate who is the latest generation in a family of firefighters; and Christopher Herrmann, a seasoned veteran who loses his home to foreclosure and now must uproot his family to move in with his in-laws.', 43);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Chicago Fire', 1, 2, 'Mon Amour', 'Severide is hiding a serious shoulder injury sustained in the fire that killed Andy Darden, and grapples with his guilt as he fights to rescue a construction worker trapped in a building collapse. Adding to the burden, Darden''s wife Heather turns on Severide at the annual firefighters'' barbecue, blaming him for her husband''s death. A call is made to an accident site at Hancock Tower, where two teenagers are pinned in a vehicle trapped beneath the falling debris of a broken window washer''s cart. Meanwhile, Casey and Hallie work to figure out their future together.', 42);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Chicago Fire', 1, 3, 'Professional Courtesy', 'Casey faces pressure to cover for a cop''s son, who was responsible for a drunken-driving accident that left a teenager paralyzed. Meanwhile, Severide ignores his doctor''s warnings that his neck injury may never heal if he doesn''t seek treatment; and Mills must choose between working at the fire department full-time or helping his mom with her restaurant.', 43);
