INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Modern Family', 1, 2, 'The Bicycle Thief', 'Phil is determined to help Luke prove to mom that he is responsible  enough to have the brand new bike they just got him. However Phil ends  up being the irresponsible one when a hot neighbor clouds his judgment.  Meanwhile Mitchell and Cameron take Lily to their first Mommy &amp; Me  class, and Jay and Manny have some awkward father and son time.', 25);
