INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('FROM', 1, 2, 'The Way Things Are Now', 'At Colony House, Tabitha and Julie grapple with their new nightmarish reality. Out in the forest, Jim, Boyd and Kristi struggle to treat Ethan’s injuries. Tragedy strikes from an unexpected source as a new threat arises among the residents of the town.', 50);
