INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('The Sopranos', 1, 1, 'The Sopranos', 'After suffering a series of mysterious anxiety attacks, New Jersey mob boss Tony Soprano agrees to see a psychiatrist, Dr. Jennifer Melfi. As he opens up to the doctor, Tony reveals details about his problems at home and at work that involve his wife Carmela, his kids Meadow and Anthony Jr., his Uncle Junior and his domineering mother Livia.', 60);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('The Sopranos', 1, 2, '46 Long', 'With acting boss Jackie Aprile dying of cancer, Tony prepares for a power struggle with Uncle Junior. Christopher and his associate Brendan make trouble for themselves when they jack a truck full of DVD players. Tony''s mother Livia finally agrees to live in a retirement community. Big Pussy and Paulie Walnuts are sent to find a stolen car.', 50);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('The Sopranos', 1, 3, 'Denial, Anger, Acceptance', 'Uncle Junior''s associate Mikey Palmice stirs things up by making Junior think Tony wants to be next in line for boss. Meanwhile, Tony, Paulie and Silvio deal with Hasidic family problems.', 45);
