INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('The Good Doctor', 1, 1, 'Burnt Food', 'Dr. Shaun Murphy, a young surgeon with autism and savant syndrome, relocates from a quiet country life to join the prestigious St. Bonaventure hospital’s surgical unit. Alone in the world and unable to personally connect with those around him, his only advocate, Dr. Aaron Glassman, challenges the skepticism and prejudices of the hospital’s board and staff when he brings him in to join the team. Shaun will need to work harder than he ever has before, as he navigates his new environment and relationships to prove to his colleagues that his extraordinary medical gifts will save lives.', 44);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('The Good Doctor', 1, 2, 'Mount Rushmore', 'Dr. Shaun Murphy’s attention to detail complicates his first day at St. Bonaventure Hospital. Meanwhile, Dr. Claire Browne learns a valuable lesson about honesty when confronted with a difficult diagnosis for her patient.', 43);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('The Good Doctor', 1, 3, 'Oliver', 'Dr. Neil Melendez and Dr. Jared Kalu discover their patient isn’t being completely honest with them which may cost him his chance at a life-saving surgery. Meanwhile, Dr. Claire Browne must learn to communicate with Dr. Shaun Murphy as they race back to St. Bonaventure Hospital with a donated organ.', 42);
