INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Modern Family', 1, 1, 'Pilot', 'Jay has just recently married his younger, Colombian wife, Gloria, but he''s having trouble keeping up with her and her son Manny. Claire is having trouble with her own family, especially with her husband Phil, who thinks he can be hip with his three kids. Also, Mitchell and his partner Cameron adopt a Vietnamese baby, Lily.', 25);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Modern Family', 1, 2, 'The Bicycle Thief', 'Phil is determined to help Luke prove to mom that he is responsible  enough to have the brand new bike they just got him. However Phil ends  up being the irresponsible one when a hot neighbor clouds his judgment.  Meanwhile Mitchell and Cameron take Lily to their first Mommy &amp; Me  class, and Jay and Manny have some awkward father and son time.', 25);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Modern Family', 1, 3, 'Come Fly with Me', 'Phil pushes Jay to go out with him and fly his new model plane. While Manny takes time out to play with Luke, Gloria accompanies Alex in shopping for a dress. Later on, Manny ends up having a heart-to-heart talk with his sister Claire.', 25);
