INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Spartacus', 1, 2, 'Sacramentum Gladiatorum', 'Enslaved in gladiatorial school, the newly christened Spartacus must try to suppress his desire for vengeance when his new master promises to reunite him with his wife.', 53);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Spartacus', 1, 3, 'Legends', 'Though Spartacus proved himself during training and now wears the attire of a gladiator, his coarse attitude and relentless quest to see his wife isolates him from his fellow gladiators and Doctore.', 53);
INSERT IGNORE INTO `Konten` (`judul`,`sinopsis`,`tahun_rilis`,`rating_usia`,`type`) VALUES ('Room of Guilty Pleasure', 'This overworked and underpaid teacher, Mr. Sasaki, has his whole life turned upside down when he stumbles upon the "Guilty Hole." He thinks it''s a dream when he sees the student''s shoe lockers have been transformed into selection panels... seeing one that catches his eye, he joking picks her... When she appears in his classroom in the middle of the night, throwing insults at him, but her eyes seem to linger on him, tinged with embarassment. "I''ll finish this quickly so... Don''t hold back, ok...?" Thus begins a forbidden relationship... Welcome to the Guilty Hole, where anything is allowed--', 2025, 'TV-MA', 'Serial_TV');
