INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Room of Guilty Pleasure', 1, 1, 'Welcome to the Room of Guilty Pleasure', 'Mamoru Sasaki, a teacher who works overtime and gets dissed by his students, hears a mysterious announcement in school at midnight. The voice welcomes him to the Room of Guilty Pleasure, where he can pick any student he likes. Assuming that it''s just a dream from the situation spread out before him, Sasaki picks one student on a whim. Led by the announcement, he enters a classroom where his sassy student, Mai Hoshino, is waiting for him, looking embarrassed...', 7);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Room of Guilty Pleasure', 1, 2, 'Would You Like to Request a Girl With Glasses?', 'After finishing his supplementary classes, Sasaki Mamoru works overtime until late at night. He is dozing off when the bell rings and wakes up, only to find himself face to face with "Guilty Hole" once again. "Which girl would you like to go with today?" Sasaki asks nervously, but chooses Takajo Makoto, the class representative. In response to Sasaki''s sincerity, Takajo says, "As a thank you for listening to my advice..." and begins to button her uniform.', 7);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Room of Guilty Pleasure', 1, 3, 'Congratulations on Unlocking the Option', 'Congratulations on unlocking the option! We have a reverse nomination today." Sasaki Mamoru can''t hide his confusion as a different message than usual comes on the air. Light spills out from his Guilty Hall membership card, and he is transported to the audiovisual room. Waiting for him there is a beaming Hojo Makoto. The letters NN are written on the blackboard. This is a dream world. As his student Hojo stares at him, Sasaki, his homeroom teacher, can no longer contain himself...', 7);
