INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('9-1-1', 1, 3, 'Next of Kin', 'Bobby and his team respond to an emergency at a children''s birthday party that leaves lives hanging in the balance. The crew jumps into action after one of their own is involved in a devastating accident. Athena tries to cope with a tragedy that hits way too close to home and Abby is confronted with a life-changing decision for her mother and makes a connection with Buck.', 43);
