INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('The Mighty Nein', 1, 2, 'Who Will You Be?', 'After surviving a shipwreck, Fjord Stone discovers he suddenly has magical powers. In Nicodranas, Jester Lavorre''s phallic pranks get her in trouble. Meanwhile, Nott''s sticky fingers nearly get her and Caleb killed, as Beau''s investigation heads South.', 48);
