INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Lost', 1, 1, 'Pilot (1)', 'Stripped of everything, the 48 survivors scavenge what they can from the plane for their survival. Some panic. Some pin their hopes on rescue. A few find inner strength they never knew they had-like Kate who, with no medical training, suddenly finds herself suturing the doctor''s wounds. The band of friends, family, enemies and strangers must work together against the cruel weather and harsh terrain. But the intense howls of  mysterious creatures stalking the jungle fill them all with fear. Fortunately, thanks to the calm leadership of quick-thinking Jack and level-headed Kate, they have hope. But even heroes have secrets, as the survivors will come to learn.', 42);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Lost', 1, 2, 'Pilot (2)', 'Having escaped the "creature" and retrieved the plane transceiver, a group of the survivors travel to higher ground so they can transmit a signal. En route, they receive a mysterious transmission and encounter another of the island''s inhabitants. Meanwhile, back at camp, Jack tends to a wounded man who reveals a secret about Kate.', 41);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Lost', 1, 3, 'Tabula Rasa', 'Jack and Hurley discover an alarming secret about Kate, as the marshal''s life hangs in the balance and he suffers a lot of pain. Meanwhile Kate, Charlie, Sawyer, Sayid, Boone and Shannon ponder the mysteries they have begun to uncover and worry that telling the other survivors will cause panic. They decide to lie for the time being. Also, Locke''s befriending of Walt disturbs Michael, but Walt is more concerned in finding his dog. Lastly, Kate flashes back to when she was arrested by the marshal in Australia.', 44);
