INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Desperate Housewives', 1, 1, 'Pilot', 'Looking down on her friends and family isn''t a way of life for Mary Alice Young. It''s a way of death. One day, in her perfect house, in the loveliest of suburbs, Mary Alice ended it all. Now she''s taking us into the lives of her family, friends and neighbors, commenting from her elevated POV. Her husband''s acting suspicious, the neighbors are talking, and her girlfriends are wondering why one of their own would do something so rash… and so messy.', 43);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Desperate Housewives', 1, 2, 'Ah, But Underneath', 'Mike''s dog pays the price when Edie crashes his dinner date with Susan. Meanwhile, Gabrielle realizes that her lawnboy is taking their fling to heart - and that Carlos may actually be catching on. Also, Bree goads Rex into therapy, where the doctor may be the one who needs the most help. Lynette resorts to drastic measures to keep her kids in line, but it blows up in her face.', 43);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Desperate Housewives', 1, 3, 'Pretty Little Picture', 'The women decide to go ahead with the big dinner party that the late Mary Alice Young had planned to host, despite the more-than-minor disturbances in their own lives. Adulterous Gabrielle finds herself with a nine-year-old blackmailer who catches Gabrielle in the act in her affair with gardener John. Also, Bree struggles to keep her crumbling marriage a secret. Lastly, Susan bares all--in more ways than one--as she confronts her ex.', 43);
INSERT IGNORE INTO `Konten` (`judul`,`sinopsis`,`tahun_rilis`,`rating_usia`,`type`) VALUES ('Monk', 'Adrian Monk was once a rising star with the San Francisco Police Department, legendary for using unconventional means to solve the department''s most baffling cases. But after the tragic (and still unsolved) murder of his wife Trudy, he developed an extreme case of obsessive-compulsive disorder. Now working as a private consultant, Monk continues to investigate cases in the most unconventional ways.', 2002, 'TV-14', 'Serial_TV');
