INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('SPY x FAMILY', 1, 1, 'OPERATION STRIX', 'Twilight is an agent that works for WISE, Westalis''s intelligence agency, and he is tasked with investigating Desmond, who is in Ostania and planning to start a war. Twilight disguises himself as the psychiatrist Loid Forger and adopts a girl named Anya so that he can enroll her into the prestigious Eden College to get closer to his target. Unbeknownst to him, Anya is actually a telepath who can read people''s minds. One day, members of a mafia group that is after Twilight kidnaps Anya. Loid realizes that he needs to reconsider his priorities and...', 25);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('SPY x FAMILY', 1, 2, 'SECURE A WIFE', 'Civil servant Yor Briar has a secret identity: an assassin named the Thorn Princess. Lately, single women had been suspected of being spies, which was making Yor nervous. Meanwhile, Loid was searching for someone to play Anya''s mother so they could attend the interview at Eden College. He just happens to run into Yor at a boutique. Anya reads Yor''s mind and finds out that she''s an assassin and tries to get Loid to ask Yor to play her mother.', 25);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('SPY x FAMILY', 1, 3, 'PREPARE FOR THE INTERVIEW', 'Yor moves in with Loid and Anya. Now that they are a family, they need to prepare for the interview. But Loid realizes with how Anya and Yor currently are, the interview probably won''t go well. In order to make sure they all understand how an upper-class family should be, Loid decides that they should all go out as a family. They go to the theatre and a museum, but it''s just not clicking with Anya and Yor. Twilight begins to lose hope, but...', 25);
