INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Kuruluş Osman', 1, 3, 'The Fire of Establishment', 'Seeing Helen and Sofia running down the aisle, Kalanoz went after her, suspecting her murder partner, Sofia, of getting involved in other things. Osman captured Teokles and the front of Theebali was blocked by Akca Dervis, Pehlivan and Zulfikar Dervis. After the trio, Bala Hatun took Osman to Edebali. I wonder what Edebali will tell Osman. What kind of plan will Dundar and Batur plan to plan for Dundar, whose daughter was kidnapped, and Zohre, who saw Osman as responsible for these events? What''s the big surprise waiting for Kalanoz, who''s going after Sofia and Helen.', 125);
INSERT IGNORE INTO `Konten` (`judul`,`sinopsis`,`tahun_rilis`,`rating_usia`,`type`) VALUES ('Smiling Friends', 'Smiling Friends Inc. is a small company whose main purpose is to bring happiness and make people smile. The series follows the day-to-day lives and misadventures of its representatives, the lazy, cynical Charlie, and the cheerful, optimistic Pim, as they try to cheer up and comfort the troubled people who call their company''s hotline. They receive seemingly simple requests but the jobs turn out to be more complicated than they seem, making it difficult to bring happiness to the world.', 2020, 'TV-MA', 'Serial_TV');
