INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Ironside', 1, 1, 'Ironside', 'While on vacation, Chief of Detectives Robert Ironside of the San Francisco police force is shot by an unknown assailant and paralyzed from the waist down. Fearing he will be forced to retire he convinces the powers that be to to make him a Special Consultant to the Commisioner of Police, who is an old friend. With his team, consisting of police detective Ed Brown, police woman Eve Whitfield, and reformed Juvenile offender Mark Sanger.  he tries to find the gunman who put him in a wheelchair.', 60);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Ironside', 1, 2, 'Message from Beyond', 'A substantial sum of money is stolen from a race-track, whilst Ironside and his team are present, and the Chief is determined to crack the case. The only clue is a car, crashed by the inside man, but if it has a secret to tell it is not going to give it up easily.', 60);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Ironside', 1, 3, 'The Leaf in the Forest', 'Lonely old women are being strangled, and Chief Ironside believes that there is more to it than just a serial killer at work. Setting Eve up as a potential victim requires a little ingenuity, but it might just prove to be worth the effort.', 60);
