INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Campfire Cooking in Another World with My Absurd Skill', 1, 1, 'My Absurd Skill Is Unexpectedly Useful', 'One day, Tsuyoshi Mukohda, an extremely ordinary salaryman, gets caught up in a hero summons being performed in another world. At the time of his summoning, he receives a unique skill known as "Online Grocery", that allows him to bring food ingredients and seasonings from his original world. Even though this skill seems plain at first glance, the food he brings into this new world has an absurd effect...!?', 24);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Campfire Cooking in Another World with My Absurd Skill', 1, 2, 'The Salient Familiar Is a Living Legend', 'After the legendary wolf monster Fenrir got attracted to the delicious smell of Mukohda''s food and signed the Familiar Contract with him, Mukohda decides to register with the Guild in Fallières his next stop.', 24);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Campfire Cooking in Another World with My Absurd Skill', 1, 3, 'My Super Power Is All About Cooking', 'After registering with both the Merchant''s and the Adventurer''s Guilds, Mukohda immediately decides to take on a beginner’s quest. However, when they deliver the monsters that Fel caught during their quest to the Guild, they find out that most of these monsters are B-rank or higher.', 24);
