INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Tatsuki Fujimoto 17-26', 1, 1, 'A Couple Clucking Chickens Were Still Kickin'' in the Schoolyard', 'It is 2019 and aliens have nearly annihilated the human race with their powerful abilities to transform. As humanity faces extinction, the aliens settle on Earth and even fully embrace human culture by living like humans once did. Today, it is alien student Yohei''s turn to feed the two chickens kept at his school. However, unbeknownst to him, those two chickens are hiding a surprising secret.', 19);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Tatsuki Fujimoto 17-26', 1, 2, 'Sasaki Stopped a Bullet', 'Sasaki''s heart beats faster every time he looks at Kawaguchi sensei. He puts her on such a high pedestal that he even reveres her as a goddess. As he is attending supplementary lessons over spring break just to see her, an armed man bursts into the classroom. Holding the students hostage at gunpoint, the man makes a selfish demand of Kawaguchi sensei, but Sasaki jumps right in front of the gun.', 18);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Tatsuki Fujimoto 17-26', 1, 3, 'Love Is Blind', 'Ibuki makes a big decision on the eve of his graduation and invites Yuri to walk home with him. Since he will attend college abroad, this will be the last time he will see her. Determined to confess his long-standing love for her, he gathers his courage, only to be interrupted by dire situations. However, those are the least of his priorities right now.', 13);
