INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Euphoria', 1, 1, 'Pilot', 'Seventeen-year-old Rue returns home from rehab with no plans to stay clean. She meets Jules, who''s new in town, at a party at McKay''s house. Nate gets in McKay''s head when McKay takes an interest in Cassie. Nate and Maddy, who have broken up once again, attempt to make each other jealous. Meanwhile, Kat is pressured to lose something big.', 54);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Euphoria', 1, 2, 'Stuntin'' Like My Daddy', 'On the first day of school, Rue''s excited about her new friend, Jules, but struggles to put the past behind her and gets into trouble at Fezco''s. Nate becomes obsessed with Maddy''s hookup, Tyler, while trying to get back together with Maddy. Kat finds out that a video of her has surfaced online. McKay takes the stress of college out on Cassie.', 60);
INSERT IGNORE INTO `Episode` (`judul_serial`,`nomor_season`,`nomor_urut_episode`,`judul_episode`,`sinopsis`,`durasi`) VALUES ('Euphoria', 1, 3, 'Made You Look', 'Kat decides to try camming and has her first session. Jules starts falling for a boy online and asks Rue to help her take some nudes. Maddy finds something odd on Nate''s phone. Cassie and McKay  spend the weekend at his school and go to a party at the frat he''s rushing. Rue is confronted about her lies at NA.', 57);
